export const ExtractPerson = (
    member,
    personName,
    personVorname,
    personGebDat,
    personSex,
    personStrasse,
    personPLZ,
    personOrt,
    personTelFestnetz,
    personTelMobil,
    personTelEmail,
    personStatus,
    personStatusDatum,
    personBank,
    personIBAN,
    personBIC
) => {
  for (const property in member) {
    switch (String(property)) {
      case "Pers_Name":
        personName = member[property];
        break;
      case "Pers_Vorname":
        personVorname = member[property];
        break;
      case "Pers_GebDat":
        personGebDat = member[property];
        break;
      case "Pers_Sex":
        personSex = member[property];
        break;
      case "Pers_Strasse":
        personStrasse = member[property];
        break;
      case "Pers_PLZ":
        personPLZ = member[property];
        break;
      case "Pers_Ort":
        personOrt = member[property];
        break;
      case "Pers_TelefonFestnetz":
        personTelFestnetz = member[property];
        break;
      case "Pers_TelefonMobil":
        personTelMobil = member[property];
        break;
      case "Pers_EMail":
        personTelEmail = member[property];
        break;
      case "Pers_Status":
        personStatus = member[property];
        break;
      case "Pers_StatusDatum":
        personStatusDatum = member[property];
        break;
      case "Pers_Bank":
        personBank = member[property];
        break;
      case "Pers_IBAN":
        personIBAN = member[property];
        break;
      case "Pers_BIC":
        personBIC = member[property];
        break;
      default:
        //console.log("Feld nicht zugewiesen");
        break;
    }
  }
  return {
    personName,
    personVorname,
    personGebDat,
    personSex,
    personStrasse,
    personPLZ,
    personOrt,
    personTelFestnetz,
    personTelMobil,
    personTelEmail,
    personStatus,
    personStatusDatum,
    personBank,
    personIBAN,
    personBIC,
  };
};
